import React, { useEffect } from 'react'

const Details = ({isbn}) => {

  useEffect(()=>{
    axios.get(`https://openlibrary.org/api/books?bibkeys=ISBN:${isbn}&jscmd=details&format=json`)
  })


  return (
    <div>Details</div>
  )
}

export default Details
